What Plants Talk About

Nature Documentary hosted by Nora Young, published by PBS broadcasted as part of PBS Nature series in 2013 - English narration


Information
------------------------------

Hard core science is effortlessly integrated with a light-hearted look at how plants behave, revealing a world where plants are as busy, responsive and complex as we are. From the stunning heights of the Great Basin Desert to the lush coastal rainforests of west coast Canada, scientist J.C. Cahill takes us on a journey into the &quot;secret world of plants,&quot; revealing an astonishing landscape where plants eavesdrop on each other, talk to their allies, call in insect mercenaries and nurture their young. It is a world of pulsing activity, where plants communicate, co-operate and, sometimes, wage all-out war. So come along for the ride and discover that plants are a lot less passive and a lot more intelligent than you think!

